/* eslint-disable */

import styles from "./Breed.module.css";

const movies = [
  "/breaking-bad.webp",
  "/the-leftovers.jpg",
  "/game-of-thrones.jpg",
  "/true-detective.jpg",
  "/walking-dead.jpg",
];

function Breed(props) {
  return (
    <>
      <div className={styles.container}>
        {movies.map((src) => (
          <div
            key={src}
            class={styles.card}
            style={{
              backgroundImage: `url(${src})`,
            }}
          />
        ))}
      </div>
    </>
  );
}

export default Breed;
